  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Lake Bowdoin
  NWR outlines Refuge accomplishments from November, 1940 through January, 1941. The
  report begins by summarizing the weather conditions during this period. Wildlife-
  including migratory birds, upland game birds, big game animals, furbearers, predators,
  and fish- is also covered. The Refuge development and maintenance section discusses
  physical developments and collections and receipts. The public relations section
  of the report describes recreational uses and hunting. N-R forms, updates on the
  easement refuges, and photographs are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
